import React from 'react';
import SearchBar from './SearchBar';
import youtube from '../APIs/youtube';


class App extends React.Component {
    onTermSubmit = (term) => {
        youtube.get('/search', {
            params: {
                q: term
            }
        });
    };

    render() {
        return (
            <div className="ui  container">
                <div><SearchBar oFormSubmit={this.onTermSubmit} /></div>
            </div>
        );
    };
}

export default App;
